CREATE TABLE IF NOT EXISTS Voter (
    `Voter_ID` INT,
    `Name` VARCHAR(18) CHARACTER SET utf8,
    `Age` INT,
    `Gender` VARCHAR(1) CHARACTER SET utf8,
    `Religon` VARCHAR(12) CHARACTER SET utf8,
    `City` VARCHAR(24) CHARACTER SET utf8,
    `Booth_Number` INT,
    `Adhar Number` INT,
    `Password` INT,
    `Security_Question` VARCHAR(12) CHARACTER SET utf8,
    `Username` VARCHAR(34) CHARACTER SET utf8,
    `Contact Number` INT,
    `Email_ID` VARCHAR(28) CHARACTER SET utf8
);
